import React from "react";

const Navbar = () => {
    return (
        <div style={{backgroundColor: "#99cc00"}}>
            <nav className="navbar">
            <h1 style={{textAlign: "center"}}>The Smart Receipt</h1>
        </nav>
        </div>
    );
};

export default Navbar;
